import 'package:flutter/material.dart';

class ImageURL extends StatefulWidget {
  const ImageURL({super.key});

  @override
  State<ImageURL> createState() => _ImageURLState();
}

class _ImageURLState extends State<ImageURL> {
  int imageIndex = 0;
  List<String> imageURL = ["data:image/jpeg;base64,"
  ,"https://images.hindustantimes.com/img/2022/07/06/550x309/dhoni-2016-getty_1654515327472_1657137509048.jpg",
  "data:image/jpeg;base64,",
  ""

  ];
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: Text("Image URL"), backgroundColor: Colors.brown),
      body: Row(
        mainAxisAlignment: MainAxisAlignment.center,
        children: [
          Column(
            mainAxisAlignment: MainAxisAlignment.center,
            children: [
              Image.network(imageURL[imageIndex], height: 300, width: 500),
              const SizedBox(height: 30),
              ElevatedButton(
                onPressed: () {
                  setState(() {
                    imageIndex++;
                  });
                },
                child: Text("Next"),
              ),
            ],
          ),
        ],
      ),
    );
  }
}
